// ==UserScript==
// @name        Baked: Auto-Click Embed
// @description Clicks "Embed" button for untrusted content, whatever that means.
// @version     1.0
// @author      AdamBlast
// @match       https://baked.live/*
// @run-at      document-start
// @grant       none
// ==/UserScript==

document.addEventListener("DOMContentLoaded", function() {
    clickEmbed;
    setTimeout(clickEmbed, 1000);
    setTimeout(clickEmbed, 2000);
});

window.addEventListener('load', function(){
    clickEmbed;
    setTimeout(clickEmbed, 1000);
    setTimeout(clickEmbed, 2000);
}, false);


function clickEmbed(){
    var btnTags = document.getElementsByTagName("button");
    var searchText = "Embed";

    for (var i = 0; i < btnTags.length; i++) {
        if (btnTags[i].innerText == searchText) {
            //alert(btnTags[i].className) // className should be "btn btn-default"
            btnTags[i].click()
            break;
        }
    }
}

//version 1.0: User Interface created, I'm sure it has no issues whatsoever and works perfectly fine. This is meant to be run by the Cookie Clicker Combo Execution Mod, if run otherwise it will not work.

Game.sesame=0 //this prevents a crash if opensesame is open, but doesn't get rid of the fps counter. Not sure what to do about that

if (typeof RedrawCCCEM === "undefined") {
  eval("Game.OpenSesame="+Game.OpenSesame.toString().replace("var str='';","return")) //prevents you from using OpenSesame as this mod removes the debugLog to make it look nice, which breaks the game if you run OpenSesame
  if (l('debugLog')) {l('debugLog').remove();};
  eval("Game.getNewTicker="+Game.getNewTicker.toString().replace("!manual && Game.T>Game.fps*10 && Game.Has('Fortune cookies') && Math.random()<(Game.HasAchiev('O Fortuna')?0.04:0.02)","!manual && Game.T>Game.fps*10 && Game.Has('Fortune cookies') && Math.random()<forceFortune")) //force fortunes to have a different chance of appearing
  eval("Game.Logic="+Game.Logic.toString().replace("if (canSave) Game.WriteSave();","if (false) Game.WriteSave();")) //disable saving
  eval("Game.shimmerTypes.golden.popFunc="+Game.shimmerTypes.golden.popFunc.toString().replace("var list=[];","var list=[]; if (seedNats==true) {Math.seedrandom(Game.seed+'/'+Game.goldenClicks);};")) //seed GCs
  eval("Game.updateBuffs="+Game.updateBuffs.toString().replace("if (buff.onDie) buff.onDie();","if (buff.onDie) buff.onDie(); FindMaxComboStr();")) //find combo multipliers when a buff dies
  };

var FtHoFOutcomes=['random','blood frenzy','click frenzy','building special','frenzy','cursed finger','multiply cookies','cookie storm','free sugar lump','cookie storm drop','blab']
var N=0
var maxComboStr=1
var relComboStr=1
var maxBSCount=0
var maxGodz=1
var iniRaw=1

FindMaxComboStr=function() {
  var mComboStr=1;
  var rComboStr=1; 
  var bsCount=0; 
  var isBS=false; 
  var godzStr=1; 
  for (var i in Game.buffs) {
    var buff=Game.buffs[i]; 
    for (var obj in Game.Objects) {
      if (Game.goldenCookieBuildingBuffs[obj][0]==buff.name) {
        isBS=true; 
        bsCount++;
        };
      };
    if (buff.multCpS) {
      mComboStr*=buff.multCpS; 
      if (isBS==false) {
        rComboStr*=buff.multCpS
        };
      }; 
    if (buff.multClick) {
      mComboStr*=buff.multClick
      if (buff.name=='Devastation') {rComboStr*=buff.multClick; godzStr*=buff.multClick};
      };
    };
  if (maxComboStr<mComboStr) {maxComboStr=mComboStr; relComboStr=rComboStr; maxBSCount=bsCount; maxGodz=godzStr}; 
  };

PrintScore=function() {
  var cookieGain=Game.cookiesEarned-iniCE
  var scoreRed=(maxComboStr*iniRaw/relComboStr);
  var score=cookieGain/scoreRed;
  console.log('Score: '+score,'Combo Strength: '+maxComboStr,'Strength of non-divided buffs: '+relComboStr,'Number of BSs: '+maxBSCount,'Strength of Godzamok: '+maxGodz,'Initial Raw CpS: '+iniRaw,'Years of CpS: '+Beautify(cookieGain/iniRaw/31536000));
  Game.Notify('Score: '+score.toPrecision(3),Beautify(cookieGain/iniRaw/31536000)+' years of CpS, GZ: '+maxGodz.toPrecision(3),[11,5]);
  };

CycleFtHoF=function()
{
	for (var i=0;i<=FtHoFOutcomes.length;i++) {if (forceFtHoF==FtHoFOutcomes[i]) {if (i!=FtHoFOutcomes.length-1) {return FtHoFOutcomes[i+1]} else {return FtHoFOutcomes[0]};};};
}

GetPrompt=function()
