            if (list1.get(0) > list2.get(0)) {   //first player is wining
                list1.add(list1.get(0));
                list1.add(list2.get(0));

                list1.remove(0);
                list2.remove(0);


            } else if (list1.get(0) < list2.get(0)) {
                list2.add(list2.get(0));
                list2.add(list1.get(0));

                list1.remove(0);
                list2.remove(0);

            } else  {

                list1.remove(0);
                list2.remove(0);
            }
        }

        int sum = 0;

        if (list1.size() > 0) {
            for (int i : list1) {
                sum += i;
            }
            System.out.printf("First player wins! Sum: %d",sum);
        } else if (list2.size() > 0) {
            for (int i : list2) {
                sum += i;
            }
            System.out.printf("Second player wins! Sum: %d",sum);
        }



    }
}

