def func(start, fin, fl5=0, fl3=0, fl45=0):

    if start>fin:
        return 0
    
    if start==fin and fl5<=4 and fl3>=2 and fl45==5:
        return 1

    return func(start*5, fin, fl5+1, fl3, fl45) + \
           func(start*3, fin, fl5, fl3+1, fl45) + \
           func(start+45, fin, fl5, fl3, fl45+1)
